			this.__recurse = -1;
			this._style = -1;
			this.__mouseEnabled = 0;
			this._buttonRectColor = "#6495edbb";
			this.holderDiv = holder;
			this._holderDivParent = holder ? holder.offsetParent : null;
			this.avg =  55;
			this.buttons = {"right":0, "left":0, "up":0, "down":0, "a":0, "b":0, "c":0, "d":0, "start":0, "back":0};
